            {/* services list */}
            <div>
              {services.map((service, index) => {
                return (
                  <div>
                    <div>
                      <h4>Service name</h4>
                    </div>
                    <div>links</div>
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Services;
